import React from 'react';
import PiXIcon from '../../components/assets/PiXIcon';
import SearchBar from '../layout/SearchBar';
import NavPanel from '../layout/NavPanel';
import Caret from '../assets/Caret';
import PiXChatIcon from '../../components/assets/PiXChatIcon';

class Navbar extends React.Component<MyProps, State> {
  state: State = {
    isNavPanelOpen: false,
    isFeedbackOpen: false
  };

  constructor(props: any){
    super(props);
    this.toggle = this.toggle.bind(this);
  }

  public toggleFeedBack = () => {
    this.setState({ 
      isFeedbackOpen: !this.state.isFeedbackOpen 
    });
  };

  render(){
    const { isNavPanelOpen } = this.state;
    return(
      <div className="Navbar-Component">
        <NavPanel isOpen={isNavPanelOpen}/>
        <PiXIcon onClick={this.toggle} />
        <Caret/>
        <SearchBar/>
        <PiXChatIcon/>
      </div>
    );
  }
}

type MyProps = {
  loggedInPerson: {
    id: string;
    firstName: string;
    lastName: string;
    username: string;
  };
  unreadMailCount: number;
  onLogout: () => any;
};

type Props = MyProps;

type State = {
  isNavPanelOpen: boolean;
  isFeedbackOpen: boolean;
};

export default Navbar;
